import styled from 'styled-components';

const Title = styled.h2`
    font-family: 'Libre Baskerville', serif;
    color: #6D71A9;
    font-size: 8vh;
    text-shadow: 2px 2px #0A0D42;
    text-align: center;
`;

export default Title;
